import React, { Component } from 'react';
import {Link} from 'react-router-dom'
class Recommend extends Component {
    render() {
        return (
            <div>
               <ul>
                   <li>
                       <Link to="/post/1">程序猿生存指南-32 实习招聘（下）</Link>
                   </li>
                   <li>
                       <Link to="/post/2"></Link>
                   </li>
                   <li>
                       <Link to="/post/3"></Link>
                   </li>
               </ul>
            </div>
        );
    }
}

export default Recommend;
